import React,{useState} from 'react'

export default function Suggestion() {
    const [openSuggestion, setopenSuggestion] = useState(false);
    const [suggestionText, setsuggestionText] = useState('');
    return (
        openSuggestion?<div className = 'suggestion'><input value = {suggestionText} onChange = {(e) => setsuggestionText(e.target.value)} type="text" />
        <button>Submit</button></div>:
        <div className = 'suggestion' onclick = {() => setopenSuggestion(true)}>Suggest a song?</div>
    )
}
